import React from 'react'
import "./Granularurea.css";

const Granularurea = () => {
  return (
    <>
    <div className="mainproducts">
        <div className="granularurea">
            <h1>Granular Urea</h1>
            <p> Granular urea is a highly regarded solid nitrogen fertilizer, prized for its small, uniform white crystals. What sets it apart is its remarkable nitrogen concentration, making it a cornerstone for promoting robust plant growth. Beyond its visual appeal, the uniform granules offer practical advantages in agriculture. The consistency in granule size ensures precise and efficient distribution, reducing the risk of nitrogen loss through processes like volatilization or leaching.</p>
        </div>
    </div>
    </>
  )
}

export default Granularurea
